import React from 'react';
import Component from './Component';


const Body =()=>{
return(
    <>
    <div className="container-fluid">
        <div className="row">
            <div className="col-sm-6 col-6">
                <Component />
            </div>
            <div className="col-sm-6 col-6">
                <Component />
            </div>


        </div>
        <div className="row">
            <div className="col-sm-4 col-6">
            <Component />
            </div>
            <div className="col-sm-4 col-6">
            <Component />
            </div>
            <div className="col-sm-4 col-6">
            <Component />
            </div>
        </div>
    </div>
    </>
    );
};

export default Body;
export {Component};
